import React,{useState, } from 'react';
import { Row, Col, Tabs ,Select,Tag,  Table, Space , Tooltip} from 'antd'; 
import { PageHeader } from '../../../components/page-headers/page-headers'; 
import { Button } from '../../../components/buttons/buttons';
import { Cards } from '../../../components/cards/frame/cards-frame'; 
import { UserTableStyleWrapper } from './style';
import { TableWrapper } from './style';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'; 
import { faPencil, faTrash } from '@fortawesome/pro-duotone-svg-icons';
import { Main } from '../../styled';  
import { 
  ChartjsStackedChart, 
} from './chartjs';
import UpdateStudentModal  from './studentmodal';
import {   
  ChartjsDonutChart, 
} from './chartjs copy';
const { TabPane } = Tabs;
const Student = () => {    
  let [datasets,setDatasets]=useState([
    {
      data: [20, 60, 50, 45, 50, 60, 70, 40, 45, 35, 25, 30],
      backgroundColor: 'rgba(0,23,55, .5)',
      label: 'BOYS',
    },
    {
      data: [10, 40, 30, 40, 60, 55, 45, 35, 30, 20, 15, 20],
      backgroundColor: 'rgba(28,225,172, .5)',
      label: 'GIRLS',
    },
])  
  const [isCreateModalVisible1, setisCreateModalVisible1] = useState(false);
  const toggleCreate1 = () => {
    setisCreateModalVisible1(!isCreateModalVisible1);
  }; 
  const usersTableColumns = [
    {
      title: 'Student Name',
      dataIndex: 'Student_Name',
      key: 'Student_Name',
      fixed: "left",
    },
    {
      title: 'Level',
      dataIndex: 'Level',
      key: 'Level', 
    },
    {
      title: 'Class',
      dataIndex: 'Class',
      key: 'Class',
    },
    {
      title: 'Address',
      dataIndex: 'Address',
      key: 'Address',
      width:'40%'
    },
    {
      title: 'Area',
      dataIndex: 'Area',
      key: 'Area',
    },
    {
      title: 'Pincode',
      dataIndex: 'Pincode',
      key: 'Pincode',
    },
    {
      title: 'Direction',
      dataIndex: 'Direction',
      key: 'Direction',
    },
    {
      title: 'Fee Status',
      dataIndex: 'Fee_Status',
      key: 'Fee_Status',
    },
    {
      title: 'Van No',
      dataIndex: 'Van_No',
      key: 'Van_No',
    },
    {
      title: 'Status',
      dataIndex: 'status',
      key: 'status',
      fixed: "right",
    },
    {
      title: 'Actions',
      dataIndex: 'action',
      key: 'action', 
      fixed:"right",
    },
  ];

  const data1=[
    
    {     
          key: 1,
          Student_Name:<span> <img
          className="task-author"
          style={{ width: '40px',borderRadius:'30px',marginRight:'5px' }}
          src={require('../../../static/img/users/1.png')}
          alt=""
        />Dinesh</span>,
          Level:'X',
          Class: 'Excellent',
          Address: <span>No.12 6th main road gomathi puram villivakkam-600034</span>,
          Area: 'Kolathur',
          Pincode:'602022',
          Direction:'2 Way',
          Fee_Status:<Tag style={{color:'white',backgroundColor:'green'}}> Paid </Tag>,
          Van_No:'33 (TN09CV1234)',
          status: <Tag style={{color:'white',backgroundColor:'green'}}>Active</Tag>,
          action: (
            <div className="table-actions">
              <>
              <Space size="middle">
              <Tooltip title="Edit">
              <FontAwesomeIcon
                icon={faPencil}
                onClick={toggleCreate1}
                style={{ fontSize: 15, color: 'green ' }}
              />
              </Tooltip> 
             
            </Space>
              </>
            </div>
          ),
        },  
  ] 
  const rowSelection = {
    getCheckboxProps: record => ({
      disabled: record.name === 'Disabled User', // Column configuration not to be checked
      name: record.name,
    }),
  };
  return (
    <div>
       <UpdateStudentModal
